r.x:
var $bm_rt;
var move, ext, inte, val, x, xb;
move = effect('move')('Slider');
ext = div(360, content('Polystar 1').content('Polystar Path 1').points);
inte = sub(180, ext);
val = Math.floor(div(move, ext));
x = val;
xb = div(move, 90);
$bm_rt = [180 + move - ext * val - ext / 2];

p.x:
var $bm_rt;
var n, r, LengthSide, move, ext, inte, val, x, xb;
n = content('Polystar 1').content('Polystar Path 1').points;
r = content('Polystar 1').content('Polystar Path 1').outerRadius;
LengthSide = mul(mul(2, r), Math.sin(div(Math.PI, n)));
move = effect('move')('Slider');
ext = div(360, content('Polystar 1').content('Polystar Path 1').points);
inte = sub(180, ext);
val = Math.floor(div(move, ext));
x = mul(val, LengthSide);
xb = div(move, ext);
$bm_rt = [
    x + value[0] - move / ext * LengthSide,
    value[1]
];

